import "./post.css";

const Post = () => {
  return (
    <div className="post-wrapper">
      <div className="post-header">
        <div className="post-header-left">
          <a href="/"></a>
        </div>
      </div>
      <div className="post-image"></div>
      <div className="post-bottom"></div>
    </div>
  );
};

export default Post;
